import React from "react";

class Userclass extends React.Component{
    constructor(props){
        super(props);
    }
        
    render(){
        return(
            <div>
                <h2>Education:Master of Computer aplication</h2>
                <h3>manme :{this.props.mname}</h3>
            </div>
        );
    }
}
export default Userclass
